import Axios from 'axios';
 
export const handleSubmitNewRso = (rsoName) =>
    {
        Axios.post('http://localhost:3001/studentHome/MainRso', {
            name: rsoName,
            universityId: sessionStorage.getItem('universiterId'),
            status: 'PENDING',
            creatorId: sessionStorage.getItem('userId'),
        });
    };
